package vo;

public class DiscussVo {

	int		d_idx;
	String	d_title;
	String	d_content;
	String	d_org_f;
	String	d_re_f;
	String	d_date;
	String	d_mod_date;
	int		d_count;
	String	user_id;
	
	public DiscussVo() {
		// TODO Auto-generated constructor stub
	}
	
	public int getD_idx() {
		return d_idx;
	}
	public void setD_idx(int d_idx) {
		this.d_idx = d_idx;
	}
	public String getD_title() {
		return d_title;
	}
	public void setD_title(String d_title) {
		this.d_title = d_title;
	}
	public String getD_content() {
		return d_content;
	}
	public void setD_content(String d_content) {
		this.d_content = d_content;
	}
	public String getD_org_f() {
		return d_org_f;
	}
	public void setD_org_f(String d_org_f) {
		this.d_org_f = d_org_f;
	}
	public String getD_re_f() {
		return d_re_f;
	}
	public void setD_re_f(String d_re_f) {
		this.d_re_f = d_re_f;
	}
	public String getD_date() {
		return d_date;
	}
	public void setD_date(String d_date) {
		this.d_date = d_date;
	}
	public String getD_mod_date() {
		return d_mod_date;
	}
	public void setD_mod_date(String d_mod_date) {
		this.d_mod_date = d_mod_date;
	}
	public int getD_count() {
		return d_count;
	}
	public void setD_count(int d_count) {
		this.d_count = d_count;
	}
	public String getUser_id() {
		return user_id;
	}
	public void setUser_id(String user_id) {
		this.user_id = user_id;
	}
	
	
}
